/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props.movies);
  }

  render() {
    return (
      <div>
        {this.props.movies.map(({ popularity, vote_count }, key) => (
          <ul key={key}>
            <li>{popularity}</li>
            <li>{vote_count}</li>
          </ul>
        ))}
      </div>
    );
  }
}

export default MovieList;
